    },
    {
      id:'e2',
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id:'e3',
      title: "Rent",
      amount: 100.17,
      date: new Date(2021, 2, 28),
    },
  ];

  return (
    <div>
      <h2>Let get started!</h2>
      <Expenses></Expenses>    
    </div>
  );
}

export default App;
